import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";

const fname = "Ismail Hasan"
const lname = "Sarker"
let date = new Date().toLocaleDateString();
let time = new Date().toLocaleTimeString();
const im1 = "https://picsum.photos/200/300";
const im2 = "https://picsum.photos/300/300";
const im3 = "https://picsum.photos/400/300";

ReactDOM.render(

  <React.Fragment>
  <h1 className="heading_one">
    Hey, my name is {`${fname} ${lname}`}
  </h1>
  <p>
    Current Date is = {date}
  </p>
  <p>
    Current Time is = {time}
  </p>



  <img src={im1} alt="onlineImage"/>
  <img src={im2} alt="onlineImage"/>
  <a href="https://www.google.com" target="_blank"><img src={im3} alt="onlineImage"/></a>


  </React.Fragment>,


  document.getElementById('root')
);
